import React from 'react';

import ImgSenai from '../../assets/images/LogoSenai.png';
import ImgEmpresa from '../../assets/images/fotoPac.png';

import '../../global.css';
import '../headerEmpresa/style.css';


function HeaderEmpresa() {
  return (
    <div>
      <nav>
        <div id="header">
          <img id="icone" src={ImgSenai} alt="" />
          <div id="href">
          <a href="">Seu perfil</a>
          <img id="fotoHeader" src={FotoPac} alt=""/>
          </div>
        </div>
        <div id="width">
          <div id="bottom"></div>
        </div>


      </nav>

    </div>
  );
}

export default HeaderEmpresa;
